const fs = require('fs');
const http = require('http');
const cheerio = require('cheerio');

function scrapeWowhead() {
  console.log('Sending request...');

  const requestOptions = {
    host: 'www.wowhead.com',
    path: '/agility-dps-trinkets',
    // path: 'not-a-real-path',
  };
  http.request(requestOptions, response => {
    console.log('Response received!');

    let str = '';
    response.on('data', chunk => { str = str + chunk; });
    response.on('end', () => {
      console.log('Response ended.  Result:');
      if (!str || !str.length) {
        console.log('Response empty: stopping');
        return;
      }

      const $ = cheerio.load(str);

      console.log('Cheerio loaded: parsing...');
      console.log(`Title: ${$('title').text()}`);
      if ($('title').text().includes('Invalid')) {
        console.log('Bad URL: 404');
        return;
      }

      const itemTable = $('div#main-contents');
      if (itemTable) {
        const items = itemTable.last('script')
        // console.log(`Item table found: ${items.length} items`);

        console.log(items.text());

      }
    });
  }).end();
}

